import React, { useState, useEffect } from 'react';
import RecipeSearch from './RecipeSearch';

function RecipeDisplay({queryData}) {
	let imagesrcs = [];
	//let results = JSON.parse(queryData);

	if(queryData) {
		for(let i = 0; i < queryData.hits.length; i++) {
			imagesrcs.push(queryData.hits[i].recipe.image);
		}
		<RecipeSearch displayQuery={true}/>

		var images = imagesrcs.map(function(image) {
			return (<img src={image} rounded />);
		});
	}

	return (
		<div>
			{images}
		</div>
	)
}

export default RecipeDisplay;
